const MenuItems = [
    {
        title: 'Burgers',
        path: '/burger'
    },
    {
        title: 'Sandwiches',
        path: '/sandwich'
    },
    {
        title: 'Baskets',
        path: '/basket'
    },
    {
        title: 'Shakes N Sweets',
        path: '/sweets'
    },
    {
        title: 'Extras',
        path: '/extras'
    }
]

export default MenuItems
